import styled from 'styled-components';
import { motion } from 'framer-motion';
import { BaseSection } from '../components/shared/BackgroundEffects';
import { useState, useEffect } from 'react';

const AITwinSection = styled(BaseSection)`
  min-height: 100vh;
  padding: 0;
  margin: 0;
  position: relative;
  overflow: hidden;
`;

const AnimationContainer = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100vh;
  z-index: 1;

  iframe {
    width: 100%;
    height: 100%;
    border: none;
  }
`;

const ContentOverlay = styled(motion.div)`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  padding: 2rem;
  z-index: 2;
  background: linear-gradient(
    to right,
    rgba(43, 16, 85, 0.9) 0%,
    rgba(43, 16, 85, 0.7) 50%,
    rgba(43, 16, 85, 0.2) 100%
  );
`;

const Title = styled(motion.h1)`
  font-size: 4rem;
  color: white;
  margin-bottom: 1rem;
  max-width: 800px;
  margin-left: 10%;
`;

const Description = styled(motion.p)`
  font-size: 1.5rem;
  color: rgba(255, 255, 255, 0.9);
  max-width: 600px;
  margin-left: 10%;
  line-height: 1.6;
`;

const AITwin = () => {
  const [iframeKey, setIframeKey] = useState(Date.now());

  useEffect(() => {
    const interval = setInterval(() => {
      setIframeKey(Date.now());
    }, 60000);

    return () => clearInterval(interval);
  }, []);

  const contentVariants = {
    hidden: { opacity: 0, x: -50 },
    visible: {
      opacity: 1,
      x: 0,
      transition: {
        duration: 0.8,
        ease: "easeOut"
      }
    }
  };

  return (
    <AITwinSection>
      <AnimationContainer>
        <iframe 
          key={iframeKey}
          src='https://my.spline.design/interfaceii-df2d3333797f27b05e95be49d9150480/'
          title="AI Digital Twin Animation"
        />
      </AnimationContainer>
      <ContentOverlay>
        <Title
          variants={contentVariants}
          initial="hidden"
          animate="visible"
        >
          AI Digital Twin
        </Title>
        <Description
          variants={contentVariants}
          initial="hidden"
          animate="visible"
          transition={{ delay: 0.2 }}
        >
          Experience the future of digital replication with our advanced AI-powered Digital Twin technology.
        </Description>
      </ContentOverlay>
    </AITwinSection>
  );
};

export default AITwin;
